import React, { useEffect, useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
  const [user, setUser] = useState(null);
  const [favorites, setFavorites] = useState([]);
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem('user'));
    setUser(storedUser);

    if (storedUser?.userId) {
      fetch(`http://localhost:5085/api/favorite/${storedUser.userId}`)
        .then(res => res.json())
        .then(setFavorites)
        .catch(err => console.error("Ошибка загрузки избранного", err));

      fetch(`http://localhost:5085/api/orders/user/${storedUser.userId}`)
        .then(res => res.json())
        .then(setOrders)
        .catch(err => console.error("Ошибка загрузки заказов", err));
    }
  }, []);

  if (!user) {
    return <div className="profile-container"><h2>Вы не авторизованы</h2></div>;
  }

  return (
    <div className="profile-container">
      <h2>Личный кабинет</h2>
      <div className="profile-info">
        <p><strong>Имя:</strong> {user.username}</p>
        <p><strong>Email:</strong> {user.email}</p>
      </div>

      <h3>Избранные товары</h3>
      <div className="favorites-list">
        {favorites.length === 0 ? (
          <p>Нет избранных товаров</p>
        ) : (
          favorites.map(product => (
            <div key={product.productId} className="favorite-card">
              <img src={product.images?.[0]?.imageUrl || '/img/placeholder.png'} alt={product.name} />
              <div>
                <p>{product.name}</p>
                <p>{product.newPrice.toLocaleString()} BYN</p>
              </div>
            </div>
          ))
        )}
      </div>

      <h3>История заказов</h3>
      <div className="orders-list">
        {orders.length === 0 ? (
          <p>У вас пока нет заказов</p>
        ) : (
          <table className="orders-table">
            <thead>
              <tr>
                <th>Номер</th>
                <th>Дата</th>
                <th>Статус</th>
                <th>Сумма</th>
              </tr>
            </thead>
            <tbody>
              {orders.map(order => (
                <tr key={order.orderId}>
                  <td>{order.orderId}</td>
                  <td>{new Date(order.createdAt).toLocaleDateString()}</td>
                  <td>{order.status}</td>
                  <td>{order.totalAmount.toLocaleString()} BYN</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default ProfilePage;
